import MyComponent from "./MyComponent";
import { drizzleConnect } from "@drizzle/react-plugin";

const mapStateToProps = state => {
  return {
    //propAddress: state.appReducers.propAddress,
    // drizzle: state
  };
};

const mapDispatchToProps = dispatch => {
  return {
    getCurrentProp: () =>  dispatch({ type: "GET_PROP_ADDRESS",propAddress:66 }),
    testSagaTest: () =>  dispatch({ type: "TEST_SAGA" }),
    onSetDrizzleState: (drizzle) => dispatch({ type: "SET_DRIZZLE_STATE", drizzle: drizzle })
  };
};

const MyContainer = drizzleConnect(MyComponent, mapStateToProps, mapDispatchToProps);

export default MyContainer;
